package com.longfe.parse.sql;import java.util.List;class TextSqlNode extends SqlNode {	String content;	List<SqlNode> sqlNodes;	public String getContent() {		return content;	}	public void setContent(String content) {		this.content = content;	}	public List<SqlNode> getSqlNodes() {		return sqlNodes;	}	public void setSqlNodes(List<SqlNode> sqlNodes) {		this.sqlNodes = sqlNodes;	}}